import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Item from './Item.js';


class List extends Component {

    static defaultProps = {
        content: "",
        itemArr: []
    }

    render() {
        const { _list } = this.props.itemArr;
        const list = _list.map(
            info => (<PhoneInfo key={info.id} info={info} />)
        );

        return (
            <div>
                {list}
            </div>
        );



        const {
            name, phone, id
        } = this.props.info;

        return (
            <div>
                <div><b>{name}</b></div>
                <div>{phone}</div>
            </div>
        );

    }
}


export default List;
